(4, 4, 'CONTINUE DRIVING AT THE SAME SPEED AND SOUND YOUR HORN', 'CONTINUE DRIVING AT THE SAME SPEED AND FLASH YOUR HEADLIGHTS', 'SLOW DOWN AND BE PREPARED TO STOP FOR CHILDREN', 'STOP AND WAVE THE CHILDREN ACROSS TO FETCH THEIR BALL.', ''),
(5, 5, 'THE CYCLIST MAY MOVE INTO THE LEFT AND DISMOUNT', 'THE CYCLIST MAY TURN EITHER WAY INTO THE ROAD', 'THE CONTENTS OF THE CYCLIST\'S CARRIER MAY FALL ONTO THE ROAD', 'THE CYCLIST MAY WISH TO TURN RIGHT AT THE END OF THE ROAD', ''),
(6, 6, '`L\'  MARK VEHICLES.', 'SLOW SPEED VEHICLES.', 'OLD VEHICLES.', 'LIGHT VEHICLES.', ''),
(7, 7, 'THEIR INTENTION IS ALWAYS TO DRIVE IN RIGHT HAND LANE.', 'THIS WILL REDUCE THEIR CONFIDENCE.', 'THEY MAY GET NERVOUS AND IT MAY LEAD TO AN ACCIDENT.', 'GENERALLY THEY ARE NOT MEDICALLY FIT.', ''),
(8, 8, 'MAKE SURE YOU STAY WELL BACK', 'LOOK OUT AS THEY MAY WOBBLE', 'BE AWARE THEY MAY SUDDENLY TURN EITHERWAY', 'ALL OF THE ABOVE', ''),
(9, 9, 'INTENDING TO TURN LEFT SHORTLY AFTERWARDS', 'APPROACHING A JUNCTION', 'THE VIEW AHEAD IS BLOCKED', 'ALL OF THE ABOVE', ''),
(10, 10, 'WHEN APPROACHING A ROUNDABOUT', 'ON A NARROW ROAD', 'JUST BEFORE YOU TURN LEFT', 'ON A RIGHT HAND BEND', ''),
(11, 11, 'GET PAST BEFORE IT MOVES', 'ALLOW IT TO PULL AWAY, IF IT IS SAFE TO DO SO', 'FLASH YOUR HEADLIGHTS AS YOU APPROACH', 'SIGNAL LEFT AND WAVE THE BUS TO MOVE ON', ''),
(12, 12, 'SOUND THE HORN', 'BRAKE FIRMLY', 'KEEP A SAFE GAP', 'FLASH YOUR LIGHTS', ''),
(13, 13, 'INCREASE YOUR SPEED.', 'BEAWARE OF SUDDEN BLAST OF WIND.', 'DRIVE ALONGSIDE VERY CLOSELY.', 'EXPECT NORMAL CONDITIONS.', ''),
(14, 14, 'CONTINUE DRIVING INTO THE INTERSECTION WITHOUT REDUCING SPEED.', 'SLOW DOWN AND BE CAREFUL', 'STOP AND ALLOW PEDESTRIANS TO CROSS', 'SOUND YOUR HORN REPEATEDLY', ''),
(15, 15, 'DRIVE TO ANOTHER INTERSECTION THAT HAS NO TRAFFIC LIGHT', 'WAIT UNTIL THE LIGHT TURNS GREEN BEFORE MAKING THE \"U\" TURN', 'MAKE THE \"U\" TURN IF THERE IS A POLICEMAN AT THE INTERSECTION.', 'AVOID MAKING A \'U\' TURN', ''),
(16, 16, 'PASS THE VEHICLE FROM LEFT HAND SIDE', 'PASS THE VEHICLE FROM RIGHT HAND SIDE', 'PASS THE VEHICLE FROM ANY CONVENIENT SIDE', 'NEVER OVERTAKE AT ALL.', ''),
(17, 17, 'AT ALL TIMES BEFORE ENTERING THE INTERSECTION.', 'ONLY WHEN THE TRAFFIC IS HEAVY', 'ONLY WHEN YOU APPROACH A STOP SIGN.', 'NONE OF THE ABOVE', ''),
(18, 18, 'SOUND YOUR HORN', 'SWITCH ON YOUR HAZARD LIGHT', 'SWITCH ON YOUR FOG LIGHT', 'SWITCH ON YOUR HEADLIGHT TO FULL BEAM', ''),
(19, 19, 'CHECK THE MIRRORS AND CHANGE LANES', 'SPEED UP AND DRIVE OVER THE GRAVEL AS QUICKLY AS POSSIBLE.', 'SLOW DOWN', 'NONE OF THE ABOVE', ''),
(20, 20, 'ACCELERATE QUICKLY TO GET PASS', 'IMMEDIATELY BRAKE TO A STOP', 'FLASH YOUR HEADLIGHTS AND ACCELERATE PASS.', 'CHECK YOUR MIRROR AND MOVE BACK BEHIND THE CAR.', ''),
(21, 21, 'CROSS IT WHENEVER YOU FEEL', 'CROSS IT WHEN THERE IS NO TRAFFIC COMING FROM THE OPPOSITE DIRECTION', 'NEVER CROSS IT UNDER ANY CIRCUMSTANCES', 'CROSS IT WHEN IT IS SAFE TO DO SO BUT SHOULD COME BACK TO YOUR LANE AFTER OVERTAKING', ''),
(22, 22, 'WHENEVER YOU FEEL IT IS SAFE TO DO SO', 'WHEN THERE IS NO TRAFFIC COMING FROM THE OPPOSITE DIRECTION', 'UNDER NO CIRCUMSTANCES', 'BUT AVOID AS FAR AS POSSIBLE', ''),
(23, 23, 'OVERTAKING PERMITTED', 'OVERTAKING NOT PERMITTED', 'OVERTAKING AND RIGHT TURNING BOTH ARE NOT PERMITTED', 'OVERTAKING NOT PERMITTED BUT RIGHT TURN PERMITTED.', ''),
(24, 24, 'TRUE', 'FALSE', 'BOTH', 'NONE', ''),
(25, 25, 'SLOW DOWN AND GIVE WAY TO PEDESTRIANS', 'SPEED UP SINCE THE SIGNAL IS IN YOUR FAVOUR', 'SPEED UP BUT TAKE CARE OF THE PEDESTRIANS', 'NONE OF THE ABOVE', ''),
(26, 26, 'IF ROAD REPAIR WORK IS IN PROGRESS NEAR THE INTERSECTION', 'IF YOU WANT TO GIVE COIN TO A BEGGAR WHO IS A LITTLE AWAY FROM YOU', 'IF BY DOING SO, YOU WILL BE BLOCKING THE INTERSECTION', 'IF A POLICEMAN ON DUTY HAS SIGNALLED YOU TO STOP', ''),
(27, 27, 'YOU SHOULD SLOW DOWN AND DRIVE WITH INCREASED CAUTION.', 'YOU SHOULD SLOW DOWN, AND GIVE RIGHT WAY TO VEHICLES APPROACHING FROM LEFT OR RIGHT SIDE', 'SIGNAL LIGHT IS OUT OF ORDER AND AS SUCH YOU SHOULD PROCEED WITH CAUTION.', 'YOU SHOULD STOP, GIVE WAY TO VEHICLES IN THE PRIORITY ROAD AND PROCEED ONLY WHEN THE WAY IS CLEAR', ''),
(28, 28, 'HURRY UP AND CROSS', 'APPLY BRAKES AND CROSS', 'SEE, IF YOU HAVE CROSSED THE STOP LINE OR ARE SO CLOSE TO IT THAT YOU CANNOT STOP SAFELY, CROSS THE INTERSECTION WITH CAUTION', 'SEE, IF THERE IS NO POLICEMAN, CROSS, OTHERWISE STOP.', ''),
(29, 29, 'RED', 'GREEN', 'BLUE', 'NONE OF THE ABOVE', ''),
(30, 30, 'PREPARE TO GO', 'GO IF THE WAY IS CLEAR', 'GO IF NO PEDESTRIANS ARE CROSSING', 'GET READY TO STOP BEFORE THE STOP LINE', ''),
(31, 31, 'EXTEND RIGHT ARM HORIZONTAL TO THE GROUND WITH PALM DOWNWARDS', 'EXTEND THE RIGHT ARM & BEND THE ELBOW AT RIGHT ANGLES AND TURNING PALM TO THE FRONT.', 'NO SIGNAL REQUIRED', 'NONE OF THE ABOVE', ''),
(32, 32, 'SLOW DOWN AND PROCEED WITH CAUTION', 'STOP, IF POSSIBLE TO DO SO, SAFELY', 'CONTINUE AT THE SAME SPEED', 'RUSH PAST THE SIGNAL', ''),
(33, 33, 'CHECK ALL AROUND FOR OTHER ROAD USERS', 'USE A DRIVEWAY IF POSSIBLE', 'KEEP YOUR HAND ON THE HANDBRAKE THROUGHOUT', 'SWITCH ON YOUR HEADLIGHTS', ''),
