(37, 37, 'SOUND THE HORN', 'USE THE MIRRORS', 'SELECT A HIGHER GEAR', 'FLASH YOUR HEADLIGHTS', ''),
(38, 38, 'LOOK AROUND BEFORE YOU MOVE OFF', 'USE ALL THE MIRRORS ON THE VEHICLE', 'GIVE A SIGNAL', 'ALL OF THE ABOVE', ''),
