(373, '', 'rta4485.jpeg', '2019-11-20 14:42:37', 273, 0, 0, 'India is the most unsafe country in the world for road users across 199 countries, as reported by the Geneva-based World Road Federations World Road Statistics 2018. Its followed by China (63,000 deaths) and the U.S. (37,000 deaths).\n\nThe annual report also reveals that of the total people killed in road crash deaths in 2018, 48% were between 18 years and 35 years old. Minors involved in road crash deaths were at 6.6% of the total deaths.\n\nOver-speeding\n\nOver-speeding is a major killer, accounting for 64.4% of the persons killed. This category was followed by driving on the wrong side of the road, which accounted for 5.8% of the accident related deaths. Use of mobile phones accounted for 2.4% of the deaths and drunken driving accounted for 2.8% of the persons killed.\n\nNot wearing helmets and seat belts are not causes of crashes, but are critical for avoiding grievous injuries and fatalities. As many as 43,614 deaths or 28.8% of totalroad accidentdeaths in the country last year were caused due to non-wearing of helmets. Non-wearing of seat belts was linked to 24,435 deaths or 16.1% of total road accident deaths in the country. Among the States, Tamil Nadu (13.7%) topped the country in terms of the total number of road crashes, followed by Madhya Pradesh (11%) and Uttar Pradesh (9.1%). The highest road fatalities were observed In Uttar Pradesh (22,256), followed by Maharashtra (13,261) and Tamil Nadu (12,216).\n\nUrgently implement\n\nCommenting on the report, Piyush Tewari, CEO and founder, SaveLIFE Foundation, said, The data provided by the government for 2018 points out that the number of road crash deaths in 2018 has increased at the national level. However, whats important to note is that a lot of States that have opposed the implementation of the Motor Vehicles Amendment Act or have reduced the fines are amongst the States with the highest road crash fatalities. The latest data highlights the urgent need on part of the States to implement keyroad safetyprovisions of the Motor Vehicles Amendment Act, 2019.\n\nUttar Pradesh, Gujarat and Uttarakhand were among the States that heavily slashed the penalties levied under the amended law.\n\n', '1'),
